import React from "react";
import "./app.css";
import Nav from "./components/Nav";
import Product from "./components/Product";
import Filter from "./components/Filter";

const App = () => {
  return (
    <>
      <Nav />
      <div className="container">
        <div className="filter">
          <Filter />
        </div>
        <div className="product__row">
          <Product />
        </div>
      </div>
    </>
  );
};

export default App;
